import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" render={() => ("Home!")}/>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
